// SPDX-License-Identifier: MIT
pragma solidity ^0.6.0;
pragma experimental ABIEncoderV2;
import "@openzeppelin/contracts/access/Ownable.sol";
//import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

contract Reservation is Ownable {

    constructor(address owner) public {
        transferOwnership(owner);
    }

    struct Info {
     uint256 no_days;
     string transport;
     bool restinclus;
     }
    uint counter;
    mapping (uint256 => Info) public _info;


    function addReservation(uint256 _no_days, string memory _transport, bool _restinclus) public {
        counter++;
        uint _num = counter;
      // Info res1;
      // res1.no_days = _no_days;
      // res1.transport = _transport;
      // res1.restinclus = _restinclus;
        _info[_num] = Info(_no_days, _transport, _restinclus);
    }

    function getReservation(uint256 _num) public view returns (Info memory) {
        return _info[_num];
    }

}
